import React from "react";
import NavBanner from "../Components/NavBanner";
import CarouselBanner from '../Components/Carousel';
import ToolBar from "../Components/ToolBar";
import PlaceholderPost from "../Components/Placeholderpost";
import { useState } from "react";
import '../css/user_account.css';
import { useEffect } from "react";
import { Navbar } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import Desktopnav from "../Components/desktopnav";

import DisplayName from "../Components/displayname";
import DisplayUsername from "../Components/displayusername";
import { BrowserView, MobileView, isBrowser, isMobile } from 'react-device-detect';



function Accountpage(){
    const [user, setUser] = useState(null);
    const navigate = useNavigate();
  
    useEffect(() => {
      const userStr = localStorage.getItem('user');
      if (userStr) {
        setUser(JSON.parse(userStr));
      }
    }, []);
  
    const logOut = () => {
      localStorage.removeItem('user');
      setUser(null);
      navigate('/Phptest');
    };
    return(
        <>  
            <NavBanner/>
            <BrowserView>
                <Desktopnav/>           
            </BrowserView>

            <MobileView>
                <ToolBar/>
            </MobileView>
            {/* <div id="user">
                <div id="user_banner"></div>
                <div id="user_profile_pic"></div>
                <div id="user_info">
                    <DisplayName/>
                    <DisplayUsername/>
                </div>
            </div> */}

<div class="wrapper">
    <main>
      <section class="hero">
        <img src="https://assets.codepen.io/9277864/twitter-banner.jpeg" alt="Twitter Banner" width="680" height="220" class="twitter-banner"/>
        <div class="profile-pic-container">
          <img src="https://assets.codepen.io/9277864/avatar.webp" alt="Tan Gravam Profile Picture" width="135" height="135" class="twitter-profile-picture"/>
        </div>
      </section>
      <section class="profile-details">
        <nav>
          <div class="icon-frame frame-cover">
            <img src="https://assets.codepen.io/9277864/menu-more.svg" alt="More Button" width="15" height="15" class="icon" />
          </div>
          <div class="icon-frame frame-cover">
            <img src="https://assets.codepen.io/9277864/envelope.svg" alt="Send Message Button" width="16" height="16" class="icon" />
          </div>
          <button class="profile-botton">
            <a href="https://twitter.com/intent/follow?screen_name=TanGravam" target="_top">Follow</a>
          </button>
        </nav>
        <div class="profile-info">
          <h1>Tan Gravam üö¢üè¥‚Äç‚ò†Ô∏è <img src="https://assets.codepen.io/9277864/badge-verified.svg" alt="Verified Badge" width="18" height="18" class="verified-badge" /></h1>
          <small>@TanGravam</small>

          <div class="account-info">
            <p>üêù Web Design & Development üî• Follow For: Daily Tasks, Challenges, Tips & Tricks</p>
            <div class="info-container-1">
              <p><img src="https://assets.codepen.io/9277864/pin-1.svg" alt="Location Icon" width="16" height="16" class="info-icon" /> <span class="location">üü©üöß‚¨úÔ∏è‚¨úÔ∏è‚¨úÔ∏è‚¨úÔ∏è‚¨úÔ∏è‚¨úÔ∏è‚¨úÔ∏è‚¨úÔ∏è </span><span>Progress</span></p>
              <p><img src="https://assets.codepen.io/9277864/hyperlink-2.svg" alt="Hyperlink Icon" width="16" height="16" class="info-icon" /> <span class="web-site"><a href="https://gravam.com" target="_top">gravam.com</a></span></p>
              <p><img src="https://assets.codepen.io/9277864/calendar-3.svg" alt="Calendar Icon" width="16" height="16" class="info-icon" /> <span>Joined March 2021</span></p>
            </div>
            <div class="info-follow">
              <p><strong>1,448</strong> <span>Following</span></p>
              <p><strong>350.8K</strong> <span>Followers</span></p>
            </div>
          </div>
        </div>
      </section>
      <section class="section-tweets">
        <ul class="tweets-nav">
          <li tabindex="0">
            <div>
              <p>Tweets</p>
            </div>
          </li>
          <li tabindex="0">
            <div>
              <p>Tweets & replies</p>
            </div>
          </li>
          <li tabindex="0">
            <div>
              <p>Media</p>
            </div>
          </li>
          <li tabindex="0">
            <div>
              <p>Likes</p>
            </div>
          </li>
        </ul>
      </section>
    </main>
    <footer>
      <small>Designed by <a href="https://twitter.com/intent/follow?screen_name=TanGravam" target="_top">@TanGravam</a></small>
    </footer>
  </div>



        </>
    )
}

export default Accountpage;
